strand = ""

#This code is designed to count each nucleotide (A, C, G, and T) in the strand of DNA.
print("Counts of each nucleotide: A, C, G, T: ")
print(str(strand.count("A")) + " " + str(strand.count("C")) + " " + str(strand.count("G")) + " " + str(strand.count("T")))


